import React from 'react';
import { Link } from 'react-router-dom';
import "./dashboard.css"
function Dashboard() {
  // window.document.body.style.backgroundColor="rgb(244, 245, 234)";
  window.document.body.style.backgroundColor="silver";
  return (
    <div className='container dashboard-cont'>
      <div className='row mt-4'>
        <div className='col-7 d-flex justify-content-start'>
          <Link to={`/${localStorage.getItem('ROLENAME')}/SendRequest`} className='mr-3'>
            <button className='btn btn-primary mx-2'>Send a Request</button>
          </Link>
          <Link to={`/${localStorage.getItem('ROLENAME')}/StatusofSend`} className='mr-3'>
            <button className='btn btn-success mx-2'>Status of Sent</button>
          </Link>
          <Link to={`/${localStorage.getItem('ROLENAME')}/ReceivedReq`} className='mr-3'>
            <button className='btn btn-success mx-2'>Received Requests</button>
          </Link>
          <Link to={`/${localStorage.getItem('ROLENAME')}/StatusofReceived`} className='mr-3'>
            <button className='btn btn-danger mx-2'>Status of Received</button>
          </Link>
          <Link to={`/${localStorage.getItem('ROLENAME')}/TrackOrder`} className='mr-3'>
            <button className='btn btn-dark mx-2'>Track Order</button>
          </Link>
          <Link to={`/${localStorage.getItem('ROLENAME')}/GetTransactions`}>
            <button className='btn btn-dark mx-2'>Get Transactions</button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
